export class RoutePath  {
    static default: string = "/";
    static home: string = "/home";
    static login: string = "/login";
    static register: string = "/register";
    static forgot_password: string = "/forgot_password";
    static contact: string = "/contact";
    static email_verification: string = "/email_verification";
    static dashboard: string = "/dashboard";
    static product_choices: string = "/product_choices";
    static checkout_payment: string = "/checkout_payment";
    static report: string = "/report/:id";
    static user_profile: string = "/user_profile";
    static reset_password: string = "/reset_password";
    static fill_url: string = "/fill_url";
    static fill_param: string = "/fill_param";
    static fill_field: string = "/fill_field";
    static graph_editor: string = "/graph_editor";
    static graph_display: string = "/graph_display";
}
